    DocumentManager.prototype.buildSelectedItemCommands = function (selectedItem) {
        var _this = this;
        if (!selectedItem) return;
        var contextualMenuItems = [];
        // Context Menu Permissions
        // - if they have permission to checkout/checkin items 
        // - if they have permission to open the item 
        // - if they have permission to download the item 
        // - if they have permission to delete an item
        // - if they have permission to view the version info
        // - if the item is checked out -- if true -- display checkin -- if false -- display checkout
        var canViewProperties = true;
        var canOpenItem = true;
        var canCheckOutItem = true;
        var canCheckInItem = true;
        var canViewItemVersions = true;
        var canDownloadItem = true;
        var canDeleteItem = true;
        // Context Menu Rules 
        // - if item is already checked out dismiss chkout and render chkin
        // - if item is already checked out dismiss chkout and render chkin
        var isCheckedOut = false;
        var checkedOutByUser = '';
        if (selectedItem["CheckedOutByUser"]) {
            if (!checkedOutByUser) checkedOutByUser = selectedItem["CheckedOutByUser"];
            console.log('>> Item is Checked Out by: ', checkedOutByUser);
            isCheckedOut = checkedOutByUser && checkedOutByUser.length > 0;
        }
        if (canViewProperties) {
            contextualMenuItems.push({
                key: 'ViewProperties',
                name: 'View Properties',
                icon: 'PreviewLink',
                onClick: function onClick() {
                    _this._RequestViewProperties();
                }
            });
        }
        if (canOpenItem) {
            contextualMenuItems.push({
                key: 'OpenSelectedItem',
                name: 'Open',
                icon: 'OpenFile',
                onClick: function onClick() {
                    _this._RequestOpenSelectedItem();
                }
            });
        }
        if (canCheckOutItem && !isCheckedOut) {
            contextualMenuItems.push({
                key: 'Checkout',
                name: 'Checkout',
                icon: 'ProtectedDocument',
                onClick: function onClick() {
                    _this._RequestCheckout();
                }
            });
        }
        if (canCheckInItem && isCheckedOut) {
            contextualMenuItems.push({
                key: 'Checkin',
                name: 'Checkin',
                icon: 'ProtectedDocument',
                onClick: function onClick() {
                    _this._RequestCheckin();
                }
            });
        }
        if (canDownloadItem) {
            contextualMenuItems.push({
                key: 'Download',
                name: 'Download a Copy',
                icon: 'Download',
                onClick: function onClick() {
                    _this._RequestDownload();
                }
            });
        }
        return contextualMenuItems;
    };
